def find_primes_between_indices(number_list):

    def is_prime(num):
        if num > 1:
            for i in range(2, num):
                if (num % i) == 0:
                    return False
            else:
                return True
        else:
            return False

    primes = [num for num in number_list[76:93] if is_prime(num)]
    primes.sort()

    return primes
